import React from 'react';
import logo from './logo.svg';
import './App.css';
import HeroHeader from './components/HeroHeader';

function App() {
  return (
    <div className="App">

      <header className="App-header">
        <HeroHeader></HeroHeader>
      </header>
      <ul>
        <li><a>Home</a></li>
        <li><a>News</a></li>
        <li><a>Contact</a></li>
        <li><a>About</a></li>
      </ul> 
    </div>
  );
}

export default App;
